#include <iostream>#include <vector>#include <algorithm>using namespace std;bool compare(pair<int, int> t1, pair<int, int> t2) {	if (t1.second == t2.second)return t1.first < t2.first;	else return t1.second < t2.second;}int main() {	int n;	cin >> n;	vector<pair<int, int>> a(n);	for (int i = 0; i < n; i++) {		scanf("%d %d", &a[i].first, &a[i].second);	}	sort(a.begin(), a.end(), compare);	for (int i = 0; i < a.size(); i++) {		printf("%d %d\n", a[i].first, a[i].second);	}}